import React from 'react'
import Card from './card'

const Products = ({ products }) => {


  return (
    <div>
      <div className="uk-child-width-1-2" data-uk-grid>
        <div>
          {products.map(product => {
            return <div key={product.id}>
              {product.title}
            </div>
          })}
        </div>
      </div>
    </div>
  )
}

export default Products
